import './App.css';
import {BrowserRouter as Router, Route, Routes, Link} from "react-router-dom"
import Home from "./pages/Home"

function App() {
  return (
    <div className="App">
      <Router>
        <Link to="">Create a post</Link>
        <Routes>
          <Route path="/" element = {<Home/>}></Route>
        </Routes>  
      </Router>  
    </div>
  );
}

export default App;
